  constructor(props){
    super(props);
    axios.get('http://localhost:8080/books').then(res => {
      const books = res.data;
      console.log(books);
    });
  }

  componentWillMount(){


  }



  render() {
    return (
      <div>
        <ul>
          <li>{/*this.state.books[0].title*/}</li>
        </ul>
